import React from "react";
import { styled } from "@mui/material/styles";
import { Grid } from "@mui/material";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import InputLabel from "@mui/material/InputLabel";
import FormControl from "@mui/material/FormControl";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import Checkbox from "@mui/material/Checkbox";
import Autocomplete from "@mui/material/Autocomplete";
import CheckBoxOutlineBlankIcon from "@mui/icons-material/CheckBoxOutlineBlank";
import CheckBoxIcon from "@mui/icons-material/CheckBox";
import Button from "@mui/material/Button";

import { useForm } from "react-hook-form";

import profileImage from "./img/rectangle11610.png";
import "./style/register.css";
import { flexbox } from "@mui/system";

const icon = <CheckBoxOutlineBlankIcon fontSize="small" />;
const checkedIcon = <CheckBoxIcon fontSize="small" />;

const Register = () => {
  const [value, setValue] = React.useState(null);

  const [gender, setGender] = React.useState("");
  const [role, setRole] = React.useState("");

  //for select
  const handleChange = (event) => {
    setGender(event.target.value);
  };
  const roleHandleChange = (event) => {
    setRole(event.target.value);
  };

  //react hook form

  const {
    register,
    formState: { errors },
    handleSubmit,
  } = useForm({
    criteriaMode: "all",
  });
  const onSubmit = (data) => console.log(data);

  return (
    <Box className="page-body">
      <Box
        className="frame-register"
        sx={{
          display: "flex",
          flexDirection: "row",
        }}
      >
        <Box className="frame-img" sx={{ marginRight: "70px" }}>
          <div className="profile-img">
            <img src={profileImage} alt="img" />
          </div>
          <div className="profile-text">Изменить фото</div>
        </Box>
        <Box mt={4} onSubmit={handleSubmit(onSubmit)}>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "baseline",
              marginBottom: "16px",
            }}
          >
            <Typography variant="body1" gutterBottom mr={6}>
              Firstname
            </Typography>
            <TextField
              id="outlined-basic"
              label="Enter firstname"
              variant="outlined"
